import React from 'react';
import { Field, reduxForm } from 'redux-form';

let Make = props => {
    return (
        <div>
            <Field name="make" component="select">
                {props.blackCar.drilldown.class_list.map(list => list.year_list.map(year => year.make_list.map(make => (
                    <option onClick={this.handleOptionClick} key={make.name} value={make.name}> {make.name} </option>
                ))))}
            </Field>
        </div>
    )
}

export default reduxForm({
    form: 'car'
})(Make)

